Please.  Guys.  Can there please be a shooter where the person gets banned not the account.  We know companies make money on banning a cheater who will buy the game a 2nd 3rd or 4th time just to cheat again.  BUT listen you will make more money on a game that you can guarantee there is no cheaters.  Your player base will be far more dedicated and be willing to invest money.  You accomplish this by banning the address, name, email of the credit card owner so they can’t just buy another copy.  A no cheater FPS game is something a lot of people are looking for.
#fps #firstpersonshooter #gaming #competitivegaming #videogames
